import React from 'react';
import './TimeLine.css';

function TimeLine() {
    return (
        <>
           <div className="timeline">
            <div className="timeline-progress"></div>
                <div className="timeline-items">
                    <div className="timeline-item"></div>
                    <div className="timeline-item"></div>
                    <div className="timeline-item"></div>
                    <div className="timeline-item"></div>
			    </div>
           </div>
        </>
    )
}

export default TimeLine
